import { Box, AppBar, Toolbar, styled, Typography, InputBase, Badge, Avatar, Menu, MenuItem } from '@mui/material'
import React, { useState } from 'react';
import { Mail, Pets, Notifications } from '@mui/icons-material'

const StyledToolbar = styled(Toolbar)(
    {
        display: "flex",
        justifyContent: "space-between",

    }
)

const Search = styled("div")(
    ({ theme }) => ({
        backgroundColor: "white",
        padding: "0 10px",
        borderRadius: theme.shape.borderRadius,
        width: "40%",
    })
)

const Icons = styled(Box)(
    ({ theme }) => ({
        display: "none",
        gap: "20px",
        [theme.breakpoints.up("sm")]: {
            display: "flex"
        },
        alignItems: "center"
    })
)

const UserBox = styled(Box)(
    ({ theme }) => ({
        display: "flex",
        gap: "10px",

        alignItems: "center",
        [theme.breakpoints.up("sm")]: {
            display: "none"
        },
    })
)


const Navbar = () => {
    const [open, setOpen] = useState(false)

    return (
        <AppBar position="sticky">
            <StyledToolbar>
                <Typography variant="h6" sx={{ display: { xs: "none", sm: "block" } }}>Ezekiel Norman</Typography>



            </StyledToolbar>

        </AppBar>
    )
}

export default Navbar
